const Fotos = ({ fotos }) => {
  return (
    <div className="card background-card">
      <div className="card-body">
        <h5 className="card-title"> {fotos.title} </h5>
        <p className="card-text">
          <img src={fotos.image} alt="" />
        </p>

        <a href="#" className="btn btn-primary">
          more
        </a>
      </div>
    </div>
  );
};
export default Fotos;
